import React from 'react'
import './App.css';
import Card from './Card';

function App() {
    
    useEffe

    return (
        <div style={{display:"flex", justifyContent:"space-around", flexWrap:"wrap", gap:"1.5rem"}}>
            {
                [...Array(50)].map((ele)=>(
                    <Card />
                ))
            }
        </div>
    )
}

export default App
